INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(1, 'Bệnh viện Hữu nghị Việt Đức', 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', 'Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n\n**Lưu ý quan trọng**\n\nBệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\nBệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\nNgười bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.\n**\nChi phí khám**\n\nNgười bệnh có thể lựa chọn một trong các gói khám sau:\n\nGói 1:\nKhám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\nKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\nGói 2:\nKhám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám\n\nTHẾ MẠNH CHUYÊN MÔN\nBệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:\n\n* Khám, điều trị, phẫu thuật về Thần kinh\n* Khám, điều trị, phẫu thuật về Cơ xương khớp\n* Khám, điều trị, phẫu thuật về Cột sống\n* Khám, điều trị, phẫu thuật về Tiêu hóa\n* Khám, điều trị, phẫu thuật về Gan mật\n* Khám, điều trị, phẫu thuật về Nam học', '<p>Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<p>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\nBệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\nNgười bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.\n**\nChi phí khám**</p>\n<p>Người bệnh có thể lựa chọn một trong các gói khám sau:</p>\n<p>Gói 1:\nKhám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\nKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\nGói 2:\nKhám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám</p>\n<p>THẾ MẠNH CHUYÊN MÔN\nBệnh viện Việt Đức là bệnh viện chuyên khoa Ngoại (phẫu thuật), có thế mạnh về khám, điều trị và Phẫu thuật nhiều chuyên khoa. Một số thế mạnh của Bệnh viện Việt Đức là:</p>\n<ul>\n<li>Khám, điều trị, phẫu thuật về Thần kinh</li>\n<li>Khám, điều trị, phẫu thuật về Cơ xương khớp</li>\n<li>Khám, điều trị, phẫu thuật về Cột sống</li>\n<li>Khám, điều trị, phẫu thuật về Tiêu hóa</li>\n<li>Khám, điều trị, phẫu thuật về Gan mật</li>\n<li>Khám, điều trị, phẫu thuật về Nam học</li>\n</ul>\n', , '2023-07-19 22:54:32', '2023-07-19 22:54:32');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Bệnh viện Chợ Rẫy', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'THẾ MẠNH CHUYÊN MÔN\nBệnh viện có 05 Trung tâm\nTrung tâm Ung bướu Chợ Rẫy.\nTrung tâm Đào tạo – Chỉ đạo tuyến.\nTrung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.\nTrung tâm Truyền máu Chợ Rẫy.\nTrung tâm Tim mạch.\n38 Khoa Lâm sàng\n04 Khoa khám bệnh ngoại trú:\n\nKhoa Khám bệnh I\nKhoa Khám bệnh II\nKhoa Chăm sóc sức khỏe theo yêu cầu.\nKhoa Khám xuất cảnh.\n34 Khoa lâm sàng.\n\nKhoa Phẫu thuật – gây mê hồi sức.\nKhoa Hồi sức – phẫu thuật tim.\nKhoa Phẫu thuật mạch máu.\nKhoa Hồi sức cấp cứu.\nKhoa Hồi sức ngoại thần kinh.\nKhoa Chấn thương sọ não.\nKhoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).\nKhoa Ngoại Tiêu hóa.\nKhoa Gan Mật Tụy.\nKhoa Ngoại Tiết Niệu.\nKhoa Chấn thương chỉnh hình.\nKhoa Tai Mũi họng.\nKhoa Tạo hình thẩm mỹ.\nKhoa Mắt.\nKhoa Ngoại lồng ngực.\nKhoa Nội tim mạch.\nKhoa Tim mạch can thiệp và Đơn vị Nhịp học.\nKhoa Nội phổi.\nKhoa Nội thận.\nKhoa Nội tiêu hóa.\nKhoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.\nKhoa Nội tổng quát (Lầu 9B1).\nKhoa Nội tổng quát – quốc tế (Lầu 10B1).\nKhoa Nội tổng quát (Lầu 10B3).\nKhoa Điều trị theo yêu cầu (T6).\nKhoa Bệnh nhiệt đới và Đơn vị Chống độc.\nKhoa Nghiên cứu & điều trị viêm gan.\nKhoa Phỏng – tạo hình.\nKhoa Nội tiết và Đơn vị Bàn chân đái tháo đường.\nKhoa Nội cơ xương khớp.\nKhoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.\nKhoa Cấp cứu.\nKhoa Thận nhân tạo.\nKhoa Vật lý trị liệu.\nBệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...\n\nBệnh Thần kinh\nBệnh Cơ xương khớp\nBệnh tiêu hóa\nTim mạch\nPhổi\nThận\nGan mật\nThận - Tiết niệu\nTai Mũi Họng\nChấn thương chỉnh hình\nMắt\nBệnh truyền nhiễm\nNội tiết\n...', '<p>THẾ MẠNH CHUYÊN MÔN\nBệnh viện có 05 Trung tâm\nTrung tâm Ung bướu Chợ Rẫy.\nTrung tâm Đào tạo – Chỉ đạo tuyến.\nTrung tâm Thông tin thuốc và theo dõi phản ứng thuốc có hại của thuốc khu vực Thành phố HCM.\nTrung tâm Truyền máu Chợ Rẫy.\nTrung tâm Tim mạch.\n38 Khoa Lâm sàng\n04 Khoa khám bệnh ngoại trú:</p>\n<p>Khoa Khám bệnh I\nKhoa Khám bệnh II\nKhoa Chăm sóc sức khỏe theo yêu cầu.\nKhoa Khám xuất cảnh.\n34 Khoa lâm sàng.</p>\n<p>Khoa Phẫu thuật – gây mê hồi sức.\nKhoa Hồi sức – phẫu thuật tim.\nKhoa Phẫu thuật mạch máu.\nKhoa Hồi sức cấp cứu.\nKhoa Hồi sức ngoại thần kinh.\nKhoa Chấn thương sọ não.\nKhoa Ngoại thần kinh (3B1,3B3, Đơn vị Gamma knife).\nKhoa Ngoại Tiêu hóa.\nKhoa Gan Mật Tụy.\nKhoa Ngoại Tiết Niệu.\nKhoa Chấn thương chỉnh hình.\nKhoa Tai Mũi họng.\nKhoa Tạo hình thẩm mỹ.\nKhoa Mắt.\nKhoa Ngoại lồng ngực.\nKhoa Nội tim mạch.\nKhoa Tim mạch can thiệp và Đơn vị Nhịp học.\nKhoa Nội phổi.\nKhoa Nội thận.\nKhoa Nội tiêu hóa.\nKhoa Nội thần kinh và Đơn vị Thăm dò chức năng thần kinh.\nKhoa Nội tổng quát (Lầu 9B1).\nKhoa Nội tổng quát – quốc tế (Lầu 10B1).\nKhoa Nội tổng quát (Lầu 10B3).\nKhoa Điều trị theo yêu cầu (T6).\nKhoa Bệnh nhiệt đới và Đơn vị Chống độc.\nKhoa Nghiên cứu &amp; điều trị viêm gan.\nKhoa Phỏng – tạo hình.\nKhoa Nội tiết và Đơn vị Bàn chân đái tháo đường.\nKhoa Nội cơ xương khớp.\nKhoa Huyết học lâm sàng - Bộ phận Xét nghiệm huyết học và Đơn vị Điều trị trong ngày.\nKhoa Cấp cứu.\nKhoa Thận nhân tạo.\nKhoa Vật lý trị liệu.\nBệnh viện Chợ Rẫy tổ chức khám và điều trị hầu hết các bệnh lý bằng nội khoa, ngoại khoa, can thiệp,...</p>\n<p>Bệnh Thần kinh\nBệnh Cơ xương khớp\nBệnh tiêu hóa\nTim mạch\nPhổi\nThận\nGan mật\nThận - Tiết niệu\nTai Mũi Họng\nChấn thương chỉnh hình\nMắt\nBệnh truyền nhiễm\nNội tiết\n...</p>\n', , '2023-07-19 22:56:24', '2023-07-19 22:56:24');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(3, 'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', 'Số 1B Trần Hưng Đạo, Quận Hai Bà Trưng, Hà Nội', 'GIỚI THIỆU\nTrung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.\n\nVì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:\n\nĐược thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\nĐược khám với quy trình khép kín, không phải di chuyển nhiều.\nĐược tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\nKhu vực khám riêng tư, lịch sự.\nĐược lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\nĐịa chỉ:Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108\n\nThời gian làm việc:\n\n6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7\nTHẾ MẠNH CHUYÊN MÔN\nTrung tâm khám sức khỏe định kì, thực hiện các dịch vụ:\n\nKhám theo yêu cầu với Bác sĩ Chuyên khoa.\nKhám theo các gói khám có sẵn hoặc linh hoạt xây dựng gói khám theo nhu cầu cá nhân. \nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\n\nTRANG THIẾT BỊ\nTrung tâm khám sức khỏe định kì được trang bị hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam đáp ứng như cầu thăm khám của người bệnh:\n\nHệ thống cộng hưởng từ MRI: 2 máy MRI 1.5 Tesla, 2 máy MRI 3.0 Tesla: Phục vụ hiệu quả trong việc hỗ trợ chẩn đoán, phát hiện các khối bất thường.\nMáy chụp CT320 dãy: Giúp phát hiện các hình ảnh bất thường ở những lát chụp rất nhỏ, hiệu quả hơn trong chẩn đoán và điều trị.\n12 máy Xquang kỹ thuật số\nChụp vú kỹ thuật số, chụp vú 3D, chụp vú có tiêm thuốc cản quang, sinh thiết vú định vị\nVới hệ thống máy móc được trang bị đầy đủ, số lượng máy cũng được chú trọng để giúp bệnh nhân không phải chờ đợi quá lâu trong quá trình thăm khám tại trung tâm.', '<p>GIỚI THIỆU\nTrung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. Hiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.</p>\n<p>Vì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:</p>\n<p>Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\nĐược khám với quy trình khép kín, không phải di chuyển nhiều.\nĐược tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\nKhu vực khám riêng tư, lịch sự.\nĐược lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\nĐịa chỉ:Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108</p>\n<p>Thời gian làm việc:</p>\n<p>6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7\nTHẾ MẠNH CHUYÊN MÔN\nTrung tâm khám sức khỏe định kì, thực hiện các dịch vụ:</p>\n<p>Khám theo yêu cầu với Bác sĩ Chuyên khoa.\nKhám theo các gói khám có sẵn hoặc linh hoạt xây dựng gói khám theo nhu cầu cá nhân.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.</p>\n<p>TRANG THIẾT BỊ\nTrung tâm khám sức khỏe định kì được trang bị hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam đáp ứng như cầu thăm khám của người bệnh:</p>\n<p>Hệ thống cộng hưởng từ MRI: 2 máy MRI 1.5 Tesla, 2 máy MRI 3.0 Tesla: Phục vụ hiệu quả trong việc hỗ trợ chẩn đoán, phát hiện các khối bất thường.\nMáy chụp CT320 dãy: Giúp phát hiện các hình ảnh bất thường ở những lát chụp rất nhỏ, hiệu quả hơn trong chẩn đoán và điều trị.\n12 máy Xquang kỹ thuật số\nChụp vú kỹ thuật số, chụp vú 3D, chụp vú có tiêm thuốc cản quang, sinh thiết vú định vị\nVới hệ thống máy móc được trang bị đầy đủ, số lượng máy cũng được chú trọng để giúp bệnh nhân không phải chờ đợi quá lâu trong quá trình thăm khám tại trung tâm.</p>\n', , '2023-07-19 22:58:32', '2023-07-19 22:58:32');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(4, 'Bệnh viện Ung bướu Hưng Việt', '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', 'Bệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. \n\nĐiểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.\n\nSự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.\n\nTHẾ MẠNH CHUYÊN MÔN\nBệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:\n\nTuyến vú\nTuyến giáp\nTiêu hóa\nĐầu - mặt - cổ\nBên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:\n\nTiêu hóa\nTai mũi họng\nNội tiết\nHô hấp\nTRANG THIẾT BỊ\nBệnh viện được trang bị đầy đủ thiết bị hỗ trợ thăm khám và điều trị ung thư hiệu quả:\n\nMáy gia tốc tuyến tính đa năng Elekta Synergy PlatForm: là máy xạ trị gia tốc hiện đại trong điều trị ung thư, có thể xạ trị được hầu hết các bệnh ung thư được chỉ định, tối ưu hoá rất cao liều xạ vào tổn thương đích (u, hạch) và hạn chế ảnh hưởng đến tổ chức lành, giảm thiểu tác dụng phụ. Hơn nữa, còn tiết kiệm thời gian so với phương pháp xạ trị ung thư thông thường khác. Đặc biệt loại máy này còn có thể tiến hành xạ trị các khối u ở các cơ quan di động mà các máy móc trước đây không thể thực hiện được.\nMáy nội soi tiêu hóa EVIS EXERA III (CV-190): Thiết bị hỗ trợ bác sĩ xác định hiệu quả các tổn thương và bất thường trong khi nội soi nhờ công nghệ xử lý chất lượng hình ảnh vượt trội, tích hợp chức năng nội soi qua dải tần hẹp (NBI), hình ảnh được chụp sắc nét ngay lần đầu tiên. \nMáy chụp Xquang vú (mamography): Giúp xác định các tổn thương ở mô tuyến vú.\nMáy chụp CT-Scanner: Hỗ trợ hữu ích trong chẩn đoán các tổn thương vùng ngực đặc biệt là ung thư phổi, tủy sống, vùng bụng,...\nMáy chụp MRI: Giúp hỗ trợ hiệu quả trong chẩn đoán các tổn thương hệ thần kinh, mạch não, tim mạch tuyến vú, vùng chậu,...\nTrung tâm hóa trị: Tùy thuộc vào loại ung bướu và tình trạng, người bệnh sẽ được các bác sĩ lên kế hoạch điều trị với hóa chất theo liều tối ưu. Trung tâm thường xuyên cập nhật kiến thức mới, phác đồ điều trị tiên tiến, hóa chất ít tác dụng phụ để ngày một nâng cao hiệu quả điều trị cho người bệnh.\nBên cạnh đó, các phòng lưu trú của bệnh viện cũng được đầu tư để bệnh nhân có khu vực nghỉ ngơi thuận tiện, thoải mái trong thời gian điều trị.', '<p>Bệnh viện Ung Bướu Hưng Việt là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p>\n<p>Điểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.</p>\n<p>Sự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.</p>\n<p>THẾ MẠNH CHUYÊN MÔN\nBệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:</p>\n<p>Tuyến vú\nTuyến giáp\nTiêu hóa\nĐầu - mặt - cổ\nBên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:</p>\n<p>Tiêu hóa\nTai mũi họng\nNội tiết\nHô hấp\nTRANG THIẾT BỊ\nBệnh viện được trang bị đầy đủ thiết bị hỗ trợ thăm khám và điều trị ung thư hiệu quả:</p>\n<p>Máy gia tốc tuyến tính đa năng Elekta Synergy PlatForm: là máy xạ trị gia tốc hiện đại trong điều trị ung thư, có thể xạ trị được hầu hết các bệnh ung thư được chỉ định, tối ưu hoá rất cao liều xạ vào tổn thương đích (u, hạch) và hạn chế ảnh hưởng đến tổ chức lành, giảm thiểu tác dụng phụ. Hơn nữa, còn tiết kiệm thời gian so với phương pháp xạ trị ung thư thông thường khác. Đặc biệt loại máy này còn có thể tiến hành xạ trị các khối u ở các cơ quan di động mà các máy móc trước đây không thể thực hiện được.\nMáy nội soi tiêu hóa EVIS EXERA III (CV-190): Thiết bị hỗ trợ bác sĩ xác định hiệu quả các tổn thương và bất thường trong khi nội soi nhờ công nghệ xử lý chất lượng hình ảnh vượt trội, tích hợp chức năng nội soi qua dải tần hẹp (NBI), hình ảnh được chụp sắc nét ngay lần đầu tiên.\nMáy chụp Xquang vú (mamography): Giúp xác định các tổn thương ở mô tuyến vú.\nMáy chụp CT-Scanner: Hỗ trợ hữu ích trong chẩn đoán các tổn thương vùng ngực đặc biệt là ung thư phổi, tủy sống, vùng bụng,...\nMáy chụp MRI: Giúp hỗ trợ hiệu quả trong chẩn đoán các tổn thương hệ thần kinh, mạch não, tim mạch tuyến vú, vùng chậu,...\nTrung tâm hóa trị: Tùy thuộc vào loại ung bướu và tình trạng, người bệnh sẽ được các bác sĩ lên kế hoạch điều trị với hóa chất theo liều tối ưu. Trung tâm thường xuyên cập nhật kiến thức mới, phác đồ điều trị tiên tiến, hóa chất ít tác dụng phụ để ngày một nâng cao hiệu quả điều trị cho người bệnh.\nBên cạnh đó, các phòng lưu trú của bệnh viện cũng được đầu tư để bệnh nhân có khu vực nghỉ ngơi thuận tiện, thoải mái trong thời gian điều trị.</p>\n', , '2023-07-19 22:59:24', '2023-