(5, 'Hệ thống y tế MEDLATEC', '42 Nghĩa Dũng, Phúc xá, Ba Đình, Hà Nội', 'GIỚI THIỆU CHUNG\nHệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 07 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:\n\nBệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội\nPhòng khám Đa khoa MEDLATEC Tây Hồ\nPhòng khám Đa khoa MEDLATEC Thanh Xuân\nPhòng khám Đa khoa MEDLATEC Vĩnh Phúc\nPhòng khám Đa khoa MEDLATEC Mê Linh\nPhòng khám Đa khoa MEDLATEC Bắc Ninh\nPhòng khám Đa khoa MEDLATEC Thanh Hóa\nPhòng khám Đa khoa MEDLATEC Cần Thơ\nCác chi nhánh, văn phòng, điểm thu gom mẫu\nBệnh viện Đa khoa MEDLATEC\n\nĐịa chỉ: 42 Nghĩa Dũng, Ba Đình, Hà Nội.\nThời gian làm việc: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\nCác dịch vụ y tế cung cấp:\nKhám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\nPhẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị tại viện: Dịch vụ đốt sóng cao tần điều trị u lành tuyến giáp.\nĐáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, MRI, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử, Giải phẫu bệnh, Vi sinh…)\nKhám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\nKhám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\nKhám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc.\nTiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai,...\nPhòng khám Đa khoa tại Hà Nội và tỉnh\n\nThời gian làm việc: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\nCác dịch vụ y tế cung cấp tại phòng khám đa khoa:\nKhám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\nĐáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử,...)\nKhám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\nKhám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\nKhám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc (áp dụng tại PKĐK MEDLATEC Tây Hồ) và Bảo lãnh viện phí (tại PKĐK MEDLATEC Vĩnh Phúc)\nTiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai (áp dụng tại PKĐK MEDLATEC Tây Hồ, MEDLATEC Thanh Xuân).\nPhục vụ lấy mẫu xét nghiệm tận nơi 24/24\n\nThời gian: 24/24h, tất cả các ngày trong tuần, kể cả ngày Lễ/Tết.\nĐịa điểm phục vụ: Tại hệ thống văn phòng và chuỗi chi nhánh ở các tỉnh, thành phố.\nTHẾ MẠNH CHUYÊN MÔN\nNgoài dịch vụ y tế khám và điều trị tại Bệnh viện và các Phòng khám Đa khoa, Hệ thống có thế mạnh về lấy mẫu xét nghiệm tận nơi và các gói khám sức khỏe tổng quát.\n\nLấy mẫu xét nghiệm tại nhà giúp khách hàng chủ động tầm soát bệnh lý định kỳ, sớm phát hiện các bệnh lý bất thường để từ đó có hướng điều trị phù hợp. Bên cạnh đó, dịch vụ còn giúp người bệnh theo dõi tiến triển của một số bệnh lý chuyển hóa như: đường máu, mỡ máu, men gan, gout,… từ đó bệnh nhân có hướng điều chỉnh chế độ ăn uống và sinh hoạt hợp lý, nâng cao chất lượng sức khỏe.\nLấy mẫu xét nghiệm tại nhà giúp giảm thời gian đi lại, chờ đợi. Kết quả xét nghiệm sẽ được trả ngay tại nhà hoặc tra cứu kết quả trên website/app\nHệ thống máy xét nghiệm đạt chuẩn quốc tế ISO 15189:2012 giúp kết quả xét nghiệm nhanh chóng, chính xác.\nGiá dịch vụ xét nghiệm tại nhà được niêm yết theo đúng bảng giá khách hàng sử dụng dịch vụ tại bệnh viện, phòng khám của MEDLATEC và chỉ mất thêm phụ phí đi lại là 10.000đ/ lần lấy mẫu.\nSau khi nhận được lịch đặt của khách hàng, nhân viên lấy mẫu sẽ gọi điện xác nhận thời gian và địa chỉ lấy mẫu xét nghiệm, đồng thời đến đúng theo lịch. Ngoài ra, tùy từng xét nghiệm sẽ có thời gian trả kết quả khác nhau, với hệ thông trang thiết bị, máy móc xét nghiệm được đầu tư hiện đại khách hàng sẽ nhận được kết quả chỉ từ 2 giờ.\nMột số gói xét nghiệm nổi bật của MEDLATEC:\n\nXét nghiệm kiểm tra sức khỏe tổng quát: tổng phân tích tế bào máu, chức năng gan mật, chức năng thận, bệnh lý đường máu, mỡ máu, bệnh Goute, Acid uric,..\nXét nghiệm marker tầm soát ung thư: AFP, CA 15-3; CA 19-9; CA 72-4; CA 125; Cyfra 21-1; tPSA; fPSA; Bence-Jones protein; SCC,…\nXét nghiệm kiểm tra các bệnh mãn tính: HbA1c, Glucose máu, Ure máu, Creatinin máu, Cholesterol, Acid uric,…\nXét nghiệm sản/phụ khoa: HPV, CA-125, nội tiết tố (progesterone, estradiol,..)\nXét nghiệm kiểm tra thai kỳ: Double test, Triple test, NIPT, Beta-hcg,...\nXét nghiệm truyền nhiễm: Viêm gan B,C, HIV, Lậu, Giang mai, Chlamydia,…', '<p>GIỚI THIỆU CHUNG\nHệ thống y tế MEDLATEC bao gồm 01 Bệnh viện Đa khoa, 07 Phòng khám Đa khoa, 33 chi nhánh, 29 văn phòng, 50 điểm thu gom mẫu trên toàn quốc:</p>\n<p>Bệnh viện Đa khoa MEDLATEC tại 42-44 Nghĩa Dũng, Ba Đình, Hà Nội\nPhòng khám Đa khoa MEDLATEC Tây Hồ\nPhòng khám Đa khoa MEDLATEC Thanh Xuân\nPhòng khám Đa khoa MEDLATEC Vĩnh Phúc\nPhòng khám Đa khoa MEDLATEC Mê Linh\nPhòng khám Đa khoa MEDLATEC Bắc Ninh\nPhòng khám Đa khoa MEDLATEC Thanh Hóa\nPhòng khám Đa khoa MEDLATEC Cần Thơ\nCác chi nhánh, văn phòng, điểm thu gom mẫu\nBệnh viện Đa khoa MEDLATEC</p>\n<p>Địa chỉ: 42 Nghĩa Dũng, Ba Đình, Hà Nội.\nThời gian làm việc: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\nCác dịch vụ y tế cung cấp:\nKhám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\nPhẫu thuật hoặc tiểu phẫu: Phẫu thuật Ung bướu, phẫu thuật Tiêu hóa, phẫu thuật Tiết niệu, phẫu thuật Nam khoa, phẫu thuật chấn thương. Điều trị tại viện: Dịch vụ đốt sóng cao tần điều trị u lành tuyến giáp.\nĐáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, MRI, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử, Giải phẫu bệnh, Vi sinh…)\nKhám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\nKhám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\nKhám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc.\nTiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai,...\nPhòng khám Đa khoa tại Hà Nội và tỉnh</p>\n<p>Thời gian làm việc: Tất cả các ngày trong tuần, kể cả ngày Lễ/Tết, từ 7h00 (mùa đông 7h30) đến 17h.\nCác dịch vụ y tế cung cấp tại phòng khám đa khoa:\nKhám, chẩn đoán và điều trị đầy đủ các chuyên khoa: Tiêu hóa, Hô hấp, Sản khoa, Truyền nhiễm, Ung bướu, Thần kinh, Cơ xương khớp, Nhi,...\nĐáp ứng đẩy đủ các kỹ thuật chẩn đoán, theo dõi điều trị bệnh: Chẩn đoán hình ảnh (Siêu âm, X quang, CT-Scanner), thăm dò chức năng (Điện tim, Nội soi,…), xét nghiệm (chuyên khoa Hóa sinh, Huyết học, Sinh học phân tử,...)\nKhám sức khỏe định kỳ/ tổng quát, khám sức khỏe tiền hôn nhân.\nKhám sức khỏe định kỳ theo Thông tư 14 hoặc theo yêu cầu: Doanh nghiệp, cơ quan, trường học, ngân hàng,…\nKhám bảo hiểm y tế, Bảo lãnh viện phí với tất cả người dân toàn quốc (áp dụng tại PKĐK MEDLATEC Tây Hồ) và Bảo lãnh viện phí (tại PKĐK MEDLATEC Vĩnh Phúc)\nTiêm vaccine phòng bệnh ở trẻ em, người lớn và phụ nữ mang thai (áp dụng tại PKĐK MEDLATEC Tây Hồ, MEDLATEC Thanh Xuân).\nPhục vụ lấy mẫu xét nghiệm tận nơi 24/24</p>\n<p>Thời gian: 24/24h, tất cả các ngày trong tuần, kể cả ngày Lễ/Tết.\nĐịa điểm phục vụ: Tại hệ thống văn phòng và chuỗi chi nhánh ở các tỉnh, thành phố.\nTHẾ MẠNH CHUYÊN MÔN\nNgoài dịch vụ y tế khám và điều trị tại Bệnh viện và các Phòng khám Đa khoa, Hệ thống có thế mạnh về lấy mẫu xét nghiệm tận nơi và các gói khám sức khỏe tổng quát.</p>\n<p>Lấy mẫu xét nghiệm tại nhà giúp khách hàng chủ động tầm soát bệnh lý định kỳ, sớm phát hiện các bệnh lý bất thường để từ đó có hướng điều trị phù hợp. Bên cạnh đó, dịch vụ còn giúp người bệnh theo dõi tiến triển của một số bệnh lý chuyển hóa như: đường máu, mỡ máu, men gan, gout,… từ đó bệnh nhân có hướng điều chỉnh chế độ ăn uống và sinh hoạt hợp lý, nâng cao chất lượng sức khỏe.\nLấy mẫu xét nghiệm tại nhà giúp giảm thời gian đi lại, chờ đợi. Kết quả xét nghiệm sẽ được trả ngay tại nhà hoặc tra cứu kết quả trên website/app\nHệ thống máy xét nghiệm đạt chuẩn quốc tế ISO 15189:2012 giúp kết quả xét nghiệm nhanh chóng, chính xác.\nGiá dịch vụ xét nghiệm tại nhà được niêm yết theo đúng bảng giá khách hàng sử dụng dịch vụ tại bệnh viện, phòng khám của MEDLATEC và chỉ mất thêm phụ phí đi lại là 10.000đ/ lần lấy mẫu.\nSau khi nhận được lịch đặt của khách hàng, nhân viên lấy mẫu sẽ gọi điện xác nhận thời gian và địa chỉ lấy mẫu xét nghiệm, đồng thời đến đúng theo lịch. Ngoài ra, tùy từng xét nghiệm sẽ có thời gian trả kết quả khác nhau, với hệ thông trang thiết bị, máy móc xét nghiệm được đầu tư hiện đại khách hàng sẽ nhận được kết quả chỉ từ 2 giờ.\nMột số gói xét nghiệm nổi bật của MEDLATEC:</p>\n<p>Xét nghiệm kiểm tra sức khỏe tổng quát: tổng phân tích tế bào máu, chức năng gan mật, chức năng thận, bệnh lý đường máu, mỡ máu, bệnh Goute, Acid uric,..\nXét nghiệm marker tầm soát ung thư: AFP, CA 15-3; CA 19-9; CA 72-4; CA 125; Cyfra 21-1; tPSA; fPSA; Bence-Jones protein; SCC,…\nXét nghiệm kiểm tra các bệnh mãn tính: HbA1c, Glucose máu, Ure máu, Creatinin máu, Cholesterol, Acid uric,…\nXét nghiệm sản/phụ khoa: HPV, CA-125, nội tiết tố (progesterone, estradiol,..)\nXét nghiệm kiểm tra thai kỳ: Double test, Triple test, NIPT, Beta-hcg,...\nXét nghiệm truyền nhiễm: Viêm gan B,C, HIV, Lậu, Giang mai, Chlamydia,…</p>\n', , '2023-07-19 23:00:05', '2023-07-19 23:00:05');
INSERT INTO `clinics` (`id`, `name`, `address`, `descriptionMarkdown`, `descriptionHTML`, `image`, `createdAt`, `updatedAt`) VALUES
(6, 'Trung tâm xét nghiệm Diag Laboratories', '414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh', 'GIỚI THIỆU CHUNG\nDiag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.\n\nDàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.\nSử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.\nDanh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.\nMạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\nCác kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.\nTrung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.\n\nĐịa chỉ: Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh\n\nTrung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n\nThời gian làm việc: \n\nGiờ mở cửa: 6h00 mỗi ngày\nGiờ đóng cửa: \nThứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)\nChủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00\nHình thức thanh toán: \n\nTrung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ\nTrung tâm có xuất hóa đơn đỏ trong vòng 24 giờ\nTHẾ MẠNH CHUYÊN MÔN\nTrung tâm xét nghiệm Diag Laboratories cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi khách hàng. Bên cạnh đó, trung tâm còn lên sẵn một số gói xét nghiệm để khách hàng thuận tiện trong việc lựa chọn và thực hiện xét nghiệm kiểm tra sức khỏe định kỳ. Một số gói xét nghiệm nổi bật như:\n\nGói xét nghiệm tổng quát nâng cao\nGói xét nghiệm tổng quát cơ bản\nGói xét nghiệm tầm soát dấu ấn ung thư nữ\nGói xét nghiệm tầm soát dấu ấn ung thư nam\nGói xét nghiệm tầm soát dị ứng\nGói xét nghiệm tầm soát sức khỏe phụ nữ nâng cao\nGói xét nghiệm tầm soát viêm gan nâng cao\nGói xét nghiệm tầm soát viêm gan cơ bản\nGói xét nghiệm ký sinh trùng cơ bản\nGói xét nghiệm tầm soát tuyến giáp chuyên sâu\nGói xét nghiệm tầm soát bệnh lý tim mạch chuyên sâu\nGói xét nghiệm tầm soát bệnh lý tiểu đường\nTRANG THIẾT BỊ\nDiag hợp tác với các đối tác cung cấp IVD lớn (IVD - thiết bị y tế chẩn đoán in vitro (IVD) là các xét nghiệm có thể phát hiện ra các bệnh, bao gồm bệnh truyền nhiễm) trên toàn cầu để xử lý các mẫu xét nghiệm, đưa đến cho khách hàng kết quả xét nghiệm mang tính chính xác cao.\n\nTrung tâm có phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại của Abbott, Roche, Sysmex, Thermo Fisher, Arkray.\n\nHiện tại, trung tâm đã ứng dụng công nghệ lấy máu chân không mang lại nhiều lợi ích cho khách hàng:\n\nRút ngắn thời gian lấy máu xuống còn 2 - 3 phút\nGiảm nguy cơ vỡ hồng cầu do máu được đưa trực tiếp vào ống (máu không tiếp xúc với không khí)\nTự động lấy đúng lượng máu cần thiết, chất lượng máu đảm bảo vì được tiếp xúc ngay với chất phụ gia trong ống\nKhông gây bệnh truyền nhiễm\nVỊ TRÍ\nTrung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam như:\n\nQuận 1, TP. Hồ Chí Minh\nQuận 2, TP. Hồ Chí Minh\nQuận 4, TP. Hồ Chí Minh\nQuận 5, TP. Hồ Chí Minh\nQuận 6, TP. Hồ Chí Minh\nQuận 7, TP. Hồ Chí Minh\nQuận 8, TP. Hồ Chí Minh\nQuận 9, TP. Hồ Chí Minh\nQuận 10, TP. Hồ Chí Minh\nQuận 11, TP. Hồ Chí Minh\nQuận 12, TP. Hồ Chí Minh\nQuận Phú Nhuận, TP. Hồ Chí Minh\nQuận Thủ Đức, TP. Hồ Chí Minh\nQuận 