(1, '<p><strong>Thạc sĩ, Bác sĩ Lê Thị Thu Hiền</strong></p>\n<ul>\n<li>Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội</li>\n<li>Hơn 10 năm kinh nghiệm, Chuyên gia về Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội (2009 - nay)</li>\n<li>Chuyên gia Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm tại Bệnh viện Nam học và Hiếm muộn Hà Nội</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Thạc sĩ Học viện Quân y (2011)</li>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y khoa Thái Nguyên (2001)</li>\n<li>Tham gia nhiều khóa đào tạo về Hỗ trợ Sinh sản, Thụ tinh trong ống nghiệm tại khoa Y - Đại học Quốc gia Tp. Hồ Chí Minh</li>\n<li>Tham gia các khóa tập huấn trong chương trình hỗ trợ sinh sản của HOSREM và Bệnh viện Từ Dũ.</li>\n<li>Tham dự nhiều khóa học, các hội nghị Quốc tế về IVF tại Châu Âu, Châu Á, Nhật, Mỹ và các nước ASEAN</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Hiếm muộn – Hỗ trợ sinh sản (Fertility – ART):</li>\n<li>Kiểm tra sức khỏe sinh sản; tư vấn kế hoạch thụ thai thành công</li>\n<li>Khám, điều trị, các bệnh lý vô sinh cho cả Nam và Nữ</li>\n<li>Vô sinh nam: không tinh trùng; tinh trùng ít, chết, dị dạng; không ống dẫn tinh; tắc ống dẫn tinh; rối loạn nội tiết; rối loạn sinh tinh; …</li>\n<li>Vô sinh nữ: rối loạn nội tiết, không phóng noãn, suy buồng trứng sớm, tắc ống dẫn trứng</li>\n<li>Kích thích rụng trứng bằng phác đồ chuẩn, hiện đại, hiệu quả cao nhất</li>\n<li>Thực hiện kỹ thuật Thụ thai nhân tạo (IUI)</li>\n<li>Thực hiện kỹ thuật Thụ tinh ống nghiệm (IVF, ICSI)</li>\n</ul>\n', '**Thạc sĩ, Bác sĩ Lê Thị Thu Hiền**\n\n* Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội\n* Hơn 10 năm kinh nghiệm, Chuyên gia về Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm\n* Bác sĩ nhận khám mọi độ tuổi\n\n**Quá trình công tác**\n\n* Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội (2009 - nay)\n* Chuyên gia Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm tại Bệnh viện Nam học và Hiếm muộn Hà Nội\n\n**Quá trình đào tạo**\n\n* Tốt nghiệp Thạc sĩ Học viện Quân y (2011)\n* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y khoa Thái Nguyên (2001)\n* Tham gia nhiều khóa đào tạo về Hỗ trợ Sinh sản, Thụ tinh trong ống nghiệm tại khoa Y - Đại học Quốc gia Tp. Hồ Chí Minh\n* Tham gia các khóa tập huấn trong chương trình hỗ trợ sinh sản của HOSREM và Bệnh viện Từ Dũ.\n* Tham dự nhiều khóa học, các hội nghị Quốc tế về IVF tại Châu Âu, Châu Á, Nhật, Mỹ và các nước ASEAN\n\n**Khám và điều trị**\n\n* Hiếm muộn – Hỗ trợ sinh sản (Fertility – ART):\n* Kiểm tra sức khỏe sinh sản; tư vấn kế hoạch thụ thai thành công\n* Khám, điều trị, các bệnh lý vô sinh cho cả Nam và Nữ\n* Vô sinh nam: không tinh trùng; tinh trùng ít, chết, dị dạng; không ống dẫn tinh; tắc ống dẫn tinh; rối loạn nội tiết; rối loạn sinh tinh; …\n* Vô sinh nữ: rối loạn nội tiết, không phóng noãn, suy buồng trứng sớm, tắc ống dẫn trứng\n* Kích thích rụng trứng bằng phác đồ chuẩn, hiện đại, hiệu quả cao nhất\n* Thực hiện kỹ thuật Thụ thai nhân tạo (IUI)\n* Thực hiện kỹ thuật Thụ tinh ống nghiệm (IVF, ICSI)', 'Phó Giám đốc, Trưởng khoa Hỗ trợ Sinh sản Bệnh viện Nam học và Hiếm muộn Hà Nội\nHơn 10 năm kinh nghiệm, Chuyên gia về Hỗ trợ sinh sản và Thụ tinh trong ống nghiệm\nBác sĩ nhận khám mọi độ tuổi', 18, NULL, NULL, '2023-06-20 14:58:56', '2023-06-27 16:44:04'),
(2, '<h2>Bác sĩ Chuyên khoa I Phí Thị Tuyết Nga</h2>\n<ul>\n<li>Hơn 30 năm kinh nghiệm trong khám và điều trị bệnh lý Sản phụ khoa</li>\n<li>Tốt nghiệp Bác sĩ chuyên khoa I chuyên ngành Sản phụ khoa, Đại học Y Hà Nội</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<p>Bác sĩ khám và điều trị bệnh lý sản phụ khoa:</p>\n<ul>\n<li>Chăm sóc sức khỏe tiền hôn nhân</li>\n<li>Chăm sóc thai kỳ: đau bụng, ra máu, động thai,...</li>\n<li>Viêm nhiễm đường sinh dục: nấm vi khuẩn, ngứa, tổn thương âm hộ,...</li>\n<li>Bệnh tình dục: sùi mào gà, lậu, giang mai, các bệnh xã hội khác,...</li>\n<li>Viêm lộ tuyến, polyp cổ tử cung</li>\n<li>Đặt vòng tránh thai, cấy que tránh thai, tiêm tránh thai</li>\n<li>Rong kinh, băng huyết</li>\n<li>Rối loạn nội tiết và kinh nguyệt</li>\n<li>Điều trị các biến chứng khi mang thai</li>\n<li>Tư vấn vô sinh hiếm muộn</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Hiện là Bác sĩ khám và điều trị, Phòng khám Sản phụ khoa Lotus Clinic</li>\n<li>Bác sĩ Sản phụ khoa, Bệnh viện Sản Nhi khu vực Thái Nguyên (1998 - 2011)</li>\n<li>Tham gia đào tạo giảng dạy lại kiến thức mới về Sức khỏe sinh sản và khống chế nhiễm khuẩn cho nhiều lớp, khóa các bác sĩ và nữ hộ sinh trong nước</li>\n<li>Bác sĩ được tổ chức Pathfinder International – Mỹ đào tạo và cấp giấy chứng nhận là giảng viên về chương trình Sức khỏe sinh sản trong nước (1999)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ chuyên khoa I chuyên ngành Sản phụ khoa, Đại học Y Hà Nội (1998)</li>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược Thái Nguyên (1992)</li>\n</ul>\n<p><strong>Chứng chỉ trong nước hoặc nước ngoài</strong></p>\n<ul>\n<li>Chứng chỉ Siêu âm tim thai nâng cao, Bệnh viện Đại học Y dược TP.HCM (2019)</li>\n<li>Chứng chỉ Chẩn đoán điều trị bệnh viêm nhiễm đường sinh dục, Bộ Y tế (2006)</li>\n<li>Chứng chỉ Siêu âm sản phụ khoa, Bệnh viện Phụ sản Trung ương (2000)</li>\n</ul>\n<p><img src=\"https://images.unsplash.com/photo-1575936123452-b67c3203c357?ixlib=rb-4.0.3&amp;ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8aW1hZ2V8ZW58MHx8MHx8fDA%3D&amp;w=1000&amp;q=80\" alt=\"img\"></p>\n', '\n## Bác sĩ Chuyên khoa I Phí Thị Tuyết Nga\n\n\n* Hơn 30 năm kinh nghiệm trong khám và điều trị bệnh lý Sản phụ khoa\n* Tốt nghiệp Bác sĩ chuyên khoa I chuyên ngành Sản phụ khoa, Đại học Y Hà Nội\n\n\n## Khám và điều trị\n\nBác sĩ khám và điều trị bệnh lý sản phụ khoa: \n\n* Chăm sóc sức khỏe tiền hôn nhân\n* Chăm sóc thai kỳ: đau bụng, ra máu, động thai,...\n* Viêm nhiễm đường sinh dục: nấm vi khuẩn, ngứa, tổn thương âm hộ,...\n* Bệnh tình dục: sùi mào gà, lậu, giang mai, các bệnh xã hội khác,...\n* Viêm lộ tuyến, polyp cổ tử cung\n* Đặt vòng tránh thai, cấy que tránh thai, tiêm tránh thai\n* Rong kinh, băng huyết\n* Rối loạn nội tiết và kinh nguyệt\n* Điều trị các biến chứng khi mang thai\n* Tư vấn vô sinh hiếm muộn\n\n**Quá trình công tác**\n\n* Hiện là Bác sĩ khám và điều trị, Phòng khám Sản phụ khoa Lotus Clinic\n* Bác sĩ Sản phụ khoa, Bệnh viện Sản Nhi khu vực Thái Nguyên (1998 - 2011)\n* Tham gia đào tạo giảng dạy lại kiến thức mới về Sức khỏe sinh sản và khống chế nhiễm khuẩn cho nhiều lớp, khóa các bác sĩ và nữ hộ sinh trong nước\n* Bác sĩ được tổ chức Pathfinder International – Mỹ đào tạo và cấp giấy chứng nhận là giảng viên về chương trình Sức khỏe sinh sản trong nước (1999)\n\n**Quá trình đào tạo**\n* Tốt nghiệp Bác sĩ chuyên khoa I chuyên ngành Sản phụ khoa, Đại học Y Hà Nội (1998)\n* Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược Thái Nguyên (1992)\n\n**Chứng chỉ trong nước hoặc nước ngoài**\n\n* Chứng chỉ Siêu âm tim thai nâng cao, Bệnh viện Đại học Y dược TP.HCM (2019)\n* Chứng chỉ Chẩn đoán điều trị bệnh viêm nhiễm đường sinh dục, Bộ Y tế (2006)\n* Chứng chỉ Siêu âm sản phụ khoa, Bệnh viện Phụ sản Trung ương (2000)\n\n![img](https://images.unsplash.com/photo-1575936123452-b67c3203c357?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8Mnx8aW1hZ2V8ZW58MHx8MHx8fDA%3D&w=1000&q=80)', 'Hơn 30 năm kinh nghiệm trong khám và điều trị bệnh lý Sản phụ khoa\nChứng nhận là giảng viên về chương trình Sức khỏe sinh sản trong nước do tổ chức Pathfinder International – Mỹ cấp\nTham gia giảng dạy kiến thức về Sức khỏe sinh sản và khống chế nhiễm khuẩn cho nhiều khóa các bác sĩ và nữ hộ sinh trong nước.', 19, NULL, NULL, '2023-06-26 16:55:12', '2023-06-27 17:40:56'),
(3, '<p><strong>Bác sĩ Chuyên khoa II Trần Minh Khuyên</strong></p>\n<ul>\n<li>Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)</li>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh</li>\n<li>Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế</li>\n<li>Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh</li>\n<li>Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh</li>\n<li>Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...</li>\n<li>Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...</li>\n<li>Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...</li>\n<li>Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...</li>\n<li>Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...</li>\n<li>Rối loạn ảo giác</li>\n<li>Các rối loạn liên quan đến stress</li>\n<li>Rối loạn khí sắc</li>\n<li>Rối loạn cảm xúc phân liệt</li>\n<li>Rối loạn đa nhân cách</li>\n<li>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Trần Minh Khuyên**\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n**Quá trình đào tạo**\n\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n**Quá trình công tác**\n\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n**Khám và điều trị**\n\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi ngủ, ác mộng, ngủ rũ,...\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ hôi tay chân, cồn cào,...\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n* Rối loạn ảo giác\n* Các rối loạn liên quan đến stress\n* Rối loạn khí sắc\n* Rối loạn cảm xúc phân liệt\n* Rối loạn đa nhân cách\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 20, NULL, NULL, '2023-06-27 16:39:18', '2023-06-27 16:39:18'),
(4, '<p><strong>Bác sĩ Chuyên khoa I Lâm Thùy Nga</strong></p>\n<p>Gần 15 năm kinh nghiệm lĩnh vực Nội Thần kinh\nHiện đang công tác tại Phòng khám Bệnh viện Đại học Y Dược 1\nTừng công tác tại Bệnh viện Gia Định\nBác sĩ nhận khám từ 15 tuổi trở lên</p>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Đột quỵ, tai biến mạch máu não</li>\n<li>Parkinson: Run, cứng, giảm vận động, rối loạn tư thế</li>\n<li>Sa sút trí tuệ: Giảm trí nhớ, khó diễn đạt, khó tập trung, hoang tưởng, loạn thần</li>\n<li>Tai biến mạch máu não: Lú lẫn, liệt nửa người, đau đầu</li>\n<li>Đau đầu</li>\n<li>Động kinh: Co giật toàn thể/ cục bộ</li>\n<li>Bệnh rễ và dây thần kinh cấp/ mạn tính: Tê bì tay chân, teo cơ, liệt vận động</li>\n<li>Nhược cơ: Yếu cơ về chiều</li>\n<li>Rối loạn tiền đình: Chóng mặt, ù tai</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Phòng khám Bệnh viện Đại học Y Dược 1 (2020 - Nay)</li>\n<li>Khoa Nội Thần kinh – Bệnh viện Gia Định (2010 - 2020)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Học Chuyên khoa I Nội Thần kinh Đại học Y Dược TP. HCM (2014 - 2016)</li>\n<li>Học chứng chỉ cấp cứu đột quỵ</li>\n<li>Thực tập khoa Nội Thần kinh Bệnh viện Chợ Rẫy (2010)</li>\n<li>Học và tốt nghiệp Đại học Y Khoa Phạm Ngọc Thạch (2003 - 2008)</li>\n<li>Sách và các công trình nghiên cứu, báo cáo khoa học</li>\n<li>SOCRATES (The Acute Stroke or Transient Ischemic Attack Treated with Asprin or Ticagrelor and Patient Ouctcomes).</li>\n<li>ENCHANTED (Enchanced Control of Hypertension and Thrombolysis Stroke Study).</li>\n<li>AFFINITY (Assessment of Fluoxetine in Stroke recovery).</li>\n<li>THALES (Acute Stroke or Transient Ischaemic Attack Treated with Ticagrelor and ASA for Prevention of Stroke and Death)</li>\n<li>Thành viên các Hội khoa học, tổ chức chuyên môn</li>\n<li>Hội viên Hội Thần kinh TP. HCM</li>\n<li>Hội Đột quỵ TP. HCM</li>\n</ul>\n', '**Bác sĩ Chuyên khoa I Lâm Thùy Nga**\n\nGần 15 năm kinh nghiệm lĩnh vực Nội Thần kinh\nHiện đang công tác tại Phòng khám Bệnh viện Đại học Y Dược 1\nTừng công tác tại Bệnh viện Gia Định\nBác sĩ nhận khám từ 15 tuổi trở lên\n\n**Khám và điều trị**\n\n* Đột quỵ, tai biến mạch máu não\n* Parkinson: Run, cứng, giảm vận động, rối loạn tư thế\n* Sa sút trí tuệ: Giảm trí nhớ, khó diễn đạt, khó tập trung, hoang tưởng, loạn thần\n* Tai biến mạch máu não: Lú lẫn, liệt nửa người, đau đầu\n* Đau đầu\n* Động kinh: Co giật toàn thể/ cục bộ\n* Bệnh rễ và dây thần kinh cấp/ mạn tính: Tê bì tay chân, teo cơ, liệt vận động\n* Nhược cơ: Yếu cơ về chiều\n* Rối loạn tiền đình: Chóng mặt, ù tai\n\n**Quá trình công tác**\n\n* Phòng khám Bệnh viện Đại học Y Dược 1 (2020 - Nay)\n* Khoa Nội Thần kinh – Bệnh viện Gia Định (2010 - 2020)\n\n**Quá trình đào tạo**\n\n* Học Chuyên khoa I Nội Thần kinh Đại học Y Dược TP. HCM (2014 - 2016)\n* Học chứng chỉ cấp cứu đột quỵ\n* Thực tập khoa Nội Thần kinh Bệnh viện Chợ Rẫy (2010)\n* Học và tốt nghiệp Đại học Y Khoa Phạm Ngọc Thạch (2003 - 2008)\n* Sách và các công trình nghiên cứu, báo cáo khoa học\n* SOCRATES (The Acute Stroke or Transient Ischemic Attack Treated with Asprin or Ticagrelor and Patient Ouctcomes).\n* ENCHANTED (Enchanced Control of Hypertension and Thrombolysis Stroke Study).\n* AFFINITY (Assessment of Fluoxetine in Stroke recovery).\n* THALES (Acute Stroke or Transient Ischaemic Attack Treated with Ticagrelor and ASA for Prevention of Stroke and Death)\n* Thành viên các Hội khoa học, tổ chức chuyên môn\n* Hội viên Hội Thần kinh TP. HCM\n* Hội Đột quỵ TP. HCM', 'Gần 15 năm kinh nghiệm lĩnh vực Nội Thần kinh\nHiện đang công tác tại Phòng khám Bệnh viện Đại học Y Dược 1\nTừng công tác tại Bệnh viện Gia Định\nBác sĩ nhận khám từ 15 tuổi trở lên', 21, NULL, NULL, '2023-06-27 16:47:26', '2023-06-27 16:47:26');

